//Code from
//ESRPATCH v0.24 - PS2 ISO patcher for ffgriever's ESR project
//By: bootsector - http://www.brunofreitas.com/

#define LBA_SIZE (2048)
int CPatcher::doPatch(char* filename)
{
	FILE *iso;
	unsigned char buffer[LBA_SIZE], tag_checksum;
	unsigned short i = 0,  is_udf = 0;
	unsigned short *desc_crc;
	unsigned short *desc_crc_len;

	if((iso = fopen(filename, "rb+")) == NULL) {
		return ESR_FILE_CANNOT_OPEN;
	}

	// Checks if ISO has an UDF descriptor
	for(i = 1; i < 64; i++) {
		fseek(iso, LBA_SIZE * i + 32768, SEEK_SET);
		fread(buffer, LBA_SIZE, 1, iso);

		// "NSR"
		if(!strncmp((char *)(buffer + 1), "NSR", 3)) {
			is_udf = 1;
			break;
		}
	}

	if(!is_udf) {
		fclose(iso);
		return ESR_FILE_NO_UDF_DESCRIPTOR;
	}

	// Checks if image is already patched
	fseek(iso, 14 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	if(!strncmp((char *)(buffer + 25), "+NSR", 4)) {
		fclose(iso);
		return ESR_FILE_ALREADY_PATCHED;
	}


	// Backups LBA 34 into 14
	fseek(iso, 34 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	fseek(iso, 14 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);

	// Backups LBA 50 into 15
	fseek(iso, 50 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	fseek(iso, 15 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);

	// Updates LBA 34
	fseek(iso, 34 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	// Updates new referenced LBA: Now it points to a DVD_VIDEO structure
	buffer[0xBC] = 0x80;
	buffer[0xBD] = 0x00;

	// Calculates new checksums
	desc_crc_len = (unsigned short *)(buffer + 10);	
	desc_crc = (unsigned short *)(buffer + 8);

	*desc_crc = crc_itu_t(0, (buffer + 16), *desc_crc_len);

	tag_checksum = 0;

	for(i = 0; i < 4; i++)
		tag_checksum += buffer[i];

	for(i = 5; i < 16; i++)
		tag_checksum += buffer[i];

	buffer[4] = tag_checksum;

	// Save modified LBA
	fseek(iso, 34 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);

	// Updates LBA 50
	fseek(iso, 50 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	// Updates new referenced LBA: Now it points to a DVD_VIDEO structure
	buffer[0xBC] = 0x80;
	buffer[0xBD] = 0x00;

	desc_crc_len = (unsigned short *)(buffer + 10);	
	desc_crc = (unsigned short *)(buffer + 8);

	*desc_crc = crc_itu_t(0, (buffer + 16), *desc_crc_len);

	// Calculates new checksums
	tag_checksum = 0;

	for(i = 0; i < 4; i++)
		tag_checksum += buffer[i];

	for(i = 5; i < 16; i++)
		tag_checksum += buffer[i];

	buffer[4] = tag_checksum;

	// Save modified LBA
	fseek(iso, 50 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);

	// Writes DVD Video data @ LBA 128
	fseek(iso, 128 * LBA_SIZE, SEEK_SET);
	fwrite(dvdvdata, sizeof(dvdvdata), 1, iso);

	fclose(iso);

	return ESR_FILE_OK;
}
int CPatcher::doUnPatch(char* filename)
{
	FILE *iso;
	unsigned char buffer[LBA_SIZE];
	unsigned short i = 0,  is_udf = 0;

	if((iso = fopen(filename, "rb+")) == NULL) {
		return ESR_FILE_CANNOT_OPEN;
	}

	// Checks if ISO has an UDF descriptor
	for(i = 1; i < 64; i++) {
		fseek(iso, LBA_SIZE * i + 32768, SEEK_SET);
		fread(buffer, LBA_SIZE, 1, iso);

		// "NSR"
		if(!strncmp((char *)(buffer + 1), "NSR", 3)) {
			is_udf = 1;
			break;
		}
	}

	if(!is_udf) {
		fclose(iso);
		return ESR_FILE_NO_UDF_DESCRIPTOR;
	}

	// Checks if image is already patched
	fseek(iso, 14 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	if(strncmp((char *)(buffer + 25), "+NSR", 4)) {
		fclose(iso);
		return ESR_FILE_NOT_PATCHED;
	}

	// Restore LBA 14 into 34
	fseek(iso, 14 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	fseek(iso, 34 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);

	// Restore LBA 15 into 50
	fseek(iso, 15 * LBA_SIZE, SEEK_SET);
	fread(buffer, LBA_SIZE, 1, iso);

	fseek(iso, 50 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);

	// Clear backups and dvdv data
	memset(buffer, 0, LBA_SIZE);
	
	fseek(iso, 14 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);
	
	fseek(iso, 15 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 1, iso);


	fseek(iso, 128 * LBA_SIZE, SEEK_SET);
	fwrite(buffer, LBA_SIZE, 12, iso);

	fclose(iso);

	return ESR_FILE_OK;
}

unsigned short CPatcher::crc_itu_t_byte(unsigned short crc, const unsigned char data)
{
	return (crc << 8) ^ crc_itu_t_table[((crc >> 8) ^ data) & 0xff];
}

unsigned short CPatcher::crc_itu_t(unsigned short crc, const unsigned char* buffer, size_t len)
{
	while (len--)
		crc = crc_itu_t_byte(crc, *buffer++);
	return crc;
}

